import './Footer.css'

function Footer(){
    return (
        <footer class="uk-background-secondary uk-flex uk-flex-between uk-flex-middle">
                <h3>Mercedes Lombardi</h3>
                <h3>Maria Guadalupe Calliera</h3>
                <h3>Lara Fernandez Olveira</h3>
        </footer>
    )
}

export default Footer
